import React from 'react';
import { Pie } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";

const Types = (props) => {

  console.log(props.beer[0]);
  const labels = ["IPA", "Sour Ale", "Saison", "Stout", "Porter", "Brown Ale", "Big Brewery Lager", "Craft Lager", "Pilsner", "Cider"];
  const data = [11, 11, 11, 11, 11, 11, 11, 11, 11, 11];

  const asdf = {
    dataPie: {
      labels: labels,
      datasets: [
        {
          data: data,
          backgroundColor: [
            "red",
            "blue",
            "yellow",
            "green",
            "brown",
            "orange",
            "purple",
            "pink",
            "lime",
            "navy",
          ],
          hoverBackgroundColor: [
            "red",
            "blue",
            "yellow",
            "green",
            "brown",
            "orange",
            "purple",
            "pink",
            "lime",
            "navy",
          ]
        }
      ]
    }
  }

  return (
    <MDBContainer>
      <h3 className="mt-5">Types of Beer</h3>
      <Pie data={asdf.dataPie} options={{ responsive: true }} />
    </MDBContainer>
  )
}

export default (Types);
